) -> impl Trait where T: PartialEq<impl Trait>, T: Iterator<Item = impl Debug>, F: Fn(impl Debug) -> impl Debug
{ let x: impl Trait = ...;
} const C: impl Trait = ...; struct S { f: impl Trait
