11.body:
Oftentimes, you have a situation where you don't care exactly what type something has, you simply care that it implements particular traits. For example, you might have a function that accepts any kind of iterator as long as it produces integers. In this case, you could write the following: fn sum_integers(integers: impl Iterator<Item = u32>) -> u32 { // ^^^^^^^^^^^^^ let mut sum = 0; for integer in integers { sum += x; } sum
} Here, the impl Iterator type is a special sort of type. It doesn't actually name any particular type. Instead, it is a shorthand for a generic type . In other words, the function above is roughly equivalent to the following desugared version: fn sum_integers<I>(integers: I) -> u32
where I: Integers<Item = u32>
{ let mut sum = 0; for integer in integers { sum += x; } sum
} Intuitively, a function that has an argument of type impl Iterator is saying "you can give me any sort of iterator that you like".

12.body:
You can also use impl trait in the return type of a function: fn odd_integers(start: u32, stop: u32) -> impl Iterator<Item = u32> { (start..stop).filter(|i| i % 2 == 0)
} When you use impl Trait in an output position like this, the meaning is slightly different. Here, the function is saying "I will give you back some kind of iteratoer over integers". The difference is that the function body is the one that selects the kind of iterator in question, rather than the caller. (In this case, that type is going to be Filter<Range<u32>, _>, where _ represents the anonymous type of the closure) The caller, meanwhile, doesn't know the precise type of Iterator they were given, only that they got "some iterator": let i = odd_integers(); // OK -- we know that `i` is an `Iterator`
let v: u32 = i.next(); // ERROR -- This method comes from `DoubleEndedIterator`, and we
// only know that `i` implements `Iterator` (in fact, the hidden
// type *does* implement `DoubleEndedIterator`, but we can't
// rely on that).
let w: u32 = i.next_back();

14.body:
When talking about output impl Traits in the previous section, we said that callers cannot rely on the precise hidden type, but must instead rely only on the declared bounds from the impl Trait. This was actually a simplification: in reality, callers are able to rely on some aspects of the hidden type. Specifically, they are able to deduce whether the hidden type implements the various auto traits , like Send and Sync: fn odd_integers(start: u32, stop: u32) -> impl Iterator<Item = u32> { (start..stop).filter(|i| i % 2 == 0)
} fn other_function() { let integers = odd_integers(); // This requires that `integers` is `Send`. // The compiler "peeks" at the hidden type // to check that this is true. std::thread::spawn(move || { for integer in integers { println!("{}", integer); } }).join();
} The motivation behind auto trait leakage is that it makes working with impl Trait as convenient as other kinds of "newtype wrappers" when it comes to threading. For example, if you were to replace the odd_integers return type with a newtype OddIntegers that hides the iterator type (as is common practice)... struct OddIntegers { iterator: Filter<Range<...>, ...>
} fn odd_integers(start: u32, stop: u32) -> OddIntegers { ... } ...you would find that OddIntegers implements Send if that hidden type (that appears in its private field) implements Send. (In this particular case, it would be challenging to create a struct because it would have to refer to the returned closure type, which is anonymous.)

15.body:
One downside of "output impl Trait" is that the returned type is anonymous. If you have a function odd_integers... fn odd_integers(start: u32, stop: u32) -> impl Iterator<Item = u32> { (start..stop).filter(|i| i % 2 == 0)
} ...there is no convenient way for users to name the returned iterator type explicitly (for example, to define a struct that embeds the returned iterator as a field). Using type alias impl impl Trait allows you to give a name that others can reference: type OddIntegers = impl Iterator<Item = u32>; fn odd_integers(start: u32, stop: u32) -> OddIntegers { (start..stop).filter(|i| i % 2 == 0)
} Here, the type alias OddIntegers is defined to alias an output impl Trait. This output impl Trait works exactly like the output impl Traits that we have seen before, except that its defining scope is the enclosing module where it is defined . Consider the following example: mod odd { pub type OddIntegers = impl Iterator<Item = u32>; pub fn odd_integers(start: u32, stop: u32) -> OddIntegers { (start..stop).filter(|i| i % 2 == 0) }
} struct TempStruct { next_odd: odd::OddIntegers,
} Here, the OddIntegers type alias is defined inside the module odd. Within odd, functions are able to define and influence the type of OddIntegers. Outside of odd, references to OddIntegers are opaque -- it simply refers to "some type that implements Iterator".
